import React from "react";
import "../App.css";

const TaskList = (props) => {
  const id = props.id;
  const name = props.taskName;
  const deadline = props.deadline;
  const status = props.status;
  return (
    <tr>
      <td>{id}</td>
      <td>{name}</td>
      <td>{deadline}</td>
      <td>{status}</td>
    </tr>
  );
};

export default TaskList;
